public void testEquals() {
    DialPointer i1 = new DialPointer.Pin(1);
    DialPointer i2 = new DialPointer.Pin(1);
    assertTrue(i1.equals(i2));

    
    i1 = new DialPointer.Pin(2);
    assertFalse(i1.equals(i2));
    i2 = new DialPointer.Pin(2);
    assertTrue(i1.equals(i2));

    
    i1.setVisible(false);
    assertFalse(i1.equals(i2));
    i2.setVisible(false);
    assertTrue(i1.equals(i2));
}

